import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';


class Project extends Component {
  render() {

    return (

      <section className="custom_project" id="project">
        <Container>
          <Row>
            <Col>
              <h1 className="mb-3 mt-3"> Projects </h1>

              <div class="mb-3 mt-3 embed-responsive embed-responsive-21by9">
              <iframe width="560" height="315" src="https://www.youtube.com/embed/sIZqCxLnLSY" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
              </div>


            </Col>


          </Row>
        </Container>
      </section>


    );
  }
}
export default Project;
